import React from "react";
import "./home.css";
const Home = () => {
    return (
        <div className="main">
            <div className="main-1">
                <h1 className="text">Join Us for a Special Event</h1>
                <p className="para">Welcome to Seed Learn a dedicated initiative focused on providing quality education to underprivileged students.</p>
                <h6 className="com ">SeedLearn.com</h6>
            </div>
            <div className="main-2"></div>
        </div>
    )
}
export default Home;
